import Food from './Food';
import Hello from "./Hello";

export default function App() {
    const h3Style = {
        color: '#293757',
        fontFamily: 'sans-serif',
        fontSize: '20pt',
        fontWeight: 900
    }

    return (
        <div style={h3Style}>
            <Food />
            <Hello />
        </div>
    );
}
